import styled from 'styled-components';

export default styled.ul`
  	width: 100%;
	list-style-type: none;
	display: flex;
	flex-flow: row-wrap;
  	justify-content: ${props => {
	  		switch(props.justify) {
	  			case 'right':
	  				console.log('right');
	  				return 'flex-end';
	  			case 'left':
	  				console.log('left');
	  				return 'flex-start';
	  			case 'center':
	  				console.log('center');
	  				return 'space-aound';  				
	  			default:
	  				console.log('default');
	  		}
  		}}
  	padding: ${props => {
	  		switch(props.justify) {
	  			case 'right':
	  				console.log('right');
	  				return '0px';
	  			case 'left':
	  				console.log('left');
	  				return '0px';
	  			case 'center':
	  				console.log('center');
	  				return '0px 8vw px 8vw';  				
	  			default:
	  				console.log('default');
	  		}
  		}}
`;
